import React, { Component } from 'react'
import { Image } from 'react'

export default class About extends Component {
  render(){
    return(
      <div className = "container placement">
          <Image 
            source={require('./it-is-i-the-fil.jpg')}  
            style={{width: 400, height: 400, borderRadius: 400/ 2}} 
            />

      things to put on:
          <ul>
            <li>short intro</li>
            <li>what I'm doing currently</li>
            {/* <li>my history</li> */}
            <li>things i like to do</li>
            <li>where I've travelled?</li>
            <li>fun facts</li>
            <li>I dream of</li>
            <li>stats on me? </li>
            <li>history</li>
            <li>picture</li>

          </ul>
      </div>
    )
  }
}
